import React from 'react';

function App() {
  return (
   <nav class="navbar navbar-expand navbar-light bg-light">
       <ul class="nav navbar-nav">
           <li class="nav-item active">
               <a class="nav-link" href="#">Nav 1</a>
           </li>
           <li class="nav-item">
               <a class="nav-link" href="#">Nav 2</a>
           </li>
       </ul>
   </nav>
  );
}

export default App;
